Featured Performers: Monique Alexander, Lexi Belle, Alexis Texas, Tori Black, Kerry-Louise, Faye Reagan, Janie Summers, Aletta Ocean

A quick peek over the fence will reveal a world beyond your wildest fantasies. It's a world of teddy bears, night gowns and pillow fights, as well as hand cuffs, dildo's and paddles. Join Janie and friends as they give new meaning to &quot;friendly neighbor&quot;. Welcome to the world of the Girl Next Door!

